// src/index.js
import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { UserProvider } from "./context/UserContext"; // Your auth context (UserProvider)
import "./styles/variables.css";
import "./styles/global.css";

// Optional: Only show in development mode - helpful for debugging
if (process.env.NODE_ENV === "development") {
  console.log("RoomieRadar Frontend (development mode) is running ðŸš€");
  console.log("API Base URL:", process.env.REACT_APP_API_BASE_URL || "http://localhost:5000/api");
}

// Get the root container
const rootElement = document.getElementById("root");

if (!rootElement) {
  throw new Error("Root container (#root) not found in index.html");
}

// Create React 18+ root
const root = ReactDOM.createRoot(rootElement);

// Render the app wrapped with UserProvider for global auth/user state
root.render(
  <React.StrictMode>
    <UserProvider>
      <App />
    </UserProvider>
  </React.StrictMode>
);

// Optional: Enable Hot Module Replacement (HMR) during development
if (module.hot) {
  module.hot.accept();
}
